import { useEffect, useState } from "react";
import logo from "../configs/media/food-logo-bg.png"
import { Link } from "react-router-dom";


const Header = () =>{
 
    const login ="Login";
    const logout = "Log-out"

    

    const [loginstate,setloginstate] = useState(login)

    const [count, setcount] = useState(1);
    
    
    useEffect(()=>{

        if(count%2===0){

            setloginstate(logout)
        }
        else{
  
            setloginstate(login);
        }

    },[count])
    

    return (
     <div className="header">
         <div className="flex justify-between items-center">
         <div className="logo-box">
             <img  className ="logo" src={logo} width="150"></img>
         </div>
 
         
 
         <div className="nav-links">
             <ul className="group flex justify-around px-8 items-center">
                 <li className="px-5 text-black"><Link to="/">Home</Link></li>

                 <li className="px-5 text-black">Cart</li>

                 <li className="px-5 text-black"><Link to="/about" className="links">About</Link></li>

                 <li className="px-5 text-black"><Link to="/contact" className="links">Contact Us</Link></li>

                 <button  className="login-btn  bg-orange-500 text-white px-5 py-2 rounded-lg  transition-transform hover:scale-110"  onClick={()=>{
                    setcount(prevcount => prevcount+1)    
                     
                    console.log("log button clicked ", count)
                 }}   
                 >{loginstate}</button>
             </ul>
         </div>
         

         </div>
        
         
     </div>
     

  

     
    )
 }
 export default Header;
